export default function ScratchImage({ ...props }) {
  let lastPoint
  let isDrawing
  let context
  const [canvas, setCanvas] = useState(null)
  const [visibility, setVisibility] = useState(false)
  const [done, setDone] = useState(false)
  const [image, setImage] = useState(null)
  const { t } = useTranslation()
  const [time, setTime] = useState(new Date().getTime())
  const [loading, setLoading] = useState(true)
  const [savedX, setSavedx] = useState([])
  const [savedY, setSavedY] = useState([])
  const [brush, setBrush] = useState(null)
  const [cover, setCover] = useState(null)
  const [brushComponent, setBrushComponent] = useState(null)
  const [coverComponent, setCoverComponent] = useState(null)
  const [canvasComponent, setCanvasComponent] = useState(null) 
  const [settings, setSettings] = useState(null)
  const [complete, setComplete] = useState(false)
  const [imageTime, setImageTime] = useState(0)
  const [imageIndex, setImageIndex] = useState(0)
  const [routes, setRoutes] =  useState<any>([])
  const [noBack, setNoBack] = useState(false)
  const classes = useStyles()
  let area = 0
  let val = 0

  const getPosition = (event: any) => {
    const target = canvas
    let offsetX = 0
    let offsetY = 0

    if (!!target && !!target?.offsetParent) {
      while ((target === (target || {})?.offsetParent)) {
        offsetX += (target || {})?.offsetLeft ?? 0
        offsetY += (target || {})?.offsetTop ?? 0
      }
    }
    const x = (event.pageX || (event.touches && event.touches[0].clientX)) - offsetX
    const y = (event.pageY || (event.touches && event.touches[0].clientY)) - offsetY
    return { x, y }
  }

  const background = () => {
    const images = [
      <Background01 key="01"/>,
      <Background02 key="02"/>,
      <Background03 key="03"/>,
      <Background04 key="04"/>,
      <Background05 key="05"/>,
      <Background06 key="06"/>,
    ]
    return images[Math.floor(Math.random() * images.length)]
  }

  useEffect(() => {
    if (done) {      
      const troutes = []
      const route = {
        duration: new Date().getTime() -imageTime,
        item: imageIndex,
        level: null,
        type: null,
        value: null,
      };
      if(routes.length > 0) {
        const r = JSON.parse(routes)
        Object.keys(r).forEach((key) => {
          troutes.push(r[key]);
        });
      }
      troutes.push(route)
      setRoutes(JSON.stringify(troutes))
      setBrushComponent(null)
      setCanvasComponent(null)
      setCoverComponent(null)     
   }
  }, [done])

  
  useEffect(() => {
    // Listen to message from child window     
    setBrushComponent(<BrushElement setBrush={setBrush} />)
    setCanvasComponent(<CanvasElement setCanvas={setCanvas} />)
    setCoverComponent(<CoverElement setCover={setCover} />)   
    const settingsData = props.data.activity?.settings ?? (props.data.settings ?? {})
    const configuration = props.data.configuration
    const langugae = configuration
      ? configuration.hasOwnProperty("language")
        ? configuration.language
        : "en-US"
      : "en-US"
    i18n.changeLanguage(langugae)
    setSettings(settingsData)   
    setNoBack(props.data.noBack)    
  }, [])

  const touchMove = (event: any) => {
    if (!isDrawing) {
      return
    }
    event.preventDefault()
    if (lastPoint != null) {
      const a = lastPoint
      const b = getPosition(event)
      const dist = Math.sqrt(Math.pow(b.x - a.x, 2) + Math.pow(b.y - a.y, 2))
      const angle = Math.atan2(b.x - a.x, b.y - a.y)
      const offsetX = (brush.width - 80) / 2
      const offsetY = (brush.height - 40) / 2
      for (let x, y, i = 0; i < dist; i++) {
        x = a.x + Math.sin(angle) * i - offsetX
        y = a.y + Math.cos(angle) * i - offsetY
        context.drawImage(brush, x, y, 80, 80)
        if (!savedX.includes(x) && !savedY.includes(y)) {
          const xValues = savedX
          const yValues = savedY
          xValues.push(y)
          yValues.push(y)
          setSavedx(xValues)
          setSavedY(yValues)
          val = val + 80
          area = canvas.width * canvas.height
          if (val > (area * (settings?.threshold ?? 80)) / 100) {
            setDone(true)
          }
        }
      }
      lastPoint = b
    }
  }

  const touchEnd = (event: any) => {
    isDrawing = false
  }

  useEffect(() => {
    setTimeout(() => {
      // Checking canvas status
      if (canvas != null && cover !== null && brush !== null) {
        canvas.width = window.innerWidth
        canvas.height = document.getElementById("canvasDiv").clientHeight
        context = canvas.getContext("2d")
        canvas.addEventListener("mousedown", touchStart)
        canvas.addEventListener("touchstart", touchStart)
        canvas.addEventListener("mousemove", touchMove)
        canvas.addEventListener("touchmove", touchMove)
        canvas.addEventListener("mouseup", touchEnd)
        canvas.addEventListener("touchend", touchEnd)
        const img = new Image()
        img.src = cover.src
        img.onload = () => {
          context.drawImage(cover, 0, 0, canvas.width, canvas.height)
          context.textAlign = "center"
          context.font = "bold 30px inter"
          context.fillText(t("Swipe around the"), canvas.width / 2, canvas.height / 2 - 35)
          context.fillText(t("screen to reveal"), canvas.width / 2, canvas.height / 2)
          context.fillText(t("the hidden image"), canvas.width / 2, canvas.height / 2 + 35)
          setImage(background())
          setImageIndex(imageIndex + 1)
          setImageTime(new Date().getTime())
          setLoading(false)
        }
      }
    }, 50); 
  }, [canvas])

  const touchStart = (event: any) => {
    isDrawing = true
    setVisibility(true)
    lastPoint = getPosition(event)
    if (context != null) {
      context.globalCompositeOperation = "destination-out"
    }
  }

  useEffect(() => {
    if(complete) {
      parent.postMessage(routes.length > 0 ? JSON.stringify({        
        timestamp: time,
        duration: new Date().getTime() - time,
        temporal_slices: JSON.parse(routes),
        static_data: {},
       }) : null, "*")      
    }
  }, [complete])

  return (
    <div>
      <Backdrop className={classes.backdrop} open={loading}>
        <CircularProgress color="inherit" />
      </Backdrop>
      {brushComponent}
      {coverComponent}
      <AppBar position="static" style={{ background: "#FBF1EF", boxShadow: "none" }}>
        <Toolbar className={classes.toolbardashboard}>
          {!noBack && <IconButton onClick={() => setComplete(true)} color="default" aria-label="Menu">
            <ArrowBackIcon />
          </IconButton>}
          <Typography variant="h5">{t("Scratch card")}</Typography>
        </Toolbar>
      </AppBar>
      <div id="canvasDiv" className={classes.background}>
        {canvasComponent}
        <Box className={classes.svgouter} style={{ display: visibility ? "block" : "none" }}>
          {image}
        </Box>
        <Box display={done ? "flex" : "none"} alignItems="center" className={classes.scratchCompleteMsg}>
          <Box width={1}>
            <Typography variant="h4">{t("Well done!")}</Typography>
            <Fab className={classes.btnpeach} onClick={() => setComplete(true)}>
              {t("Close")}
            </Fab>
            <Box width={1} mt={3}>
              <Link
                className={classes.linkpeach}
                onClick={() => {
                  setBrushComponent(<BrushElement setBrush={setBrush} />)
                  setCanvasComponent(<CanvasElement setCanvas={setCanvas} />)
                  setCoverComponent(<CoverElement setCover={setCover} />)
                  setVisibility(false)
                  setDone(false)
                }}
              >
                {t("Do another one")}
              </Link>
            </Box>
          </Box>
        </Box>
      </div>
    </div>
  )
}
